import React from 'react';

function Footer() {
 return (
  <section class="copyright py-4 text-center text-white">
    <div class="container">
      Toto Initiative &copy; 2020
      <br />
      Made with <i class="fas fa-paw"></i> in NYC.
    </div>
  </section>
 )
}

export default Footer;
